import React from 'react';
import { useNavigate  } from 'react-router-dom';

const botaoVoltar = () => {
  const history = useNavigate();

  const handleGoBack = () => {
    history.goBack();
  };

  return (
    <button onClick={handleGoBack}>
      Voltar
    </button>
  );
};

export default botaoVoltar;
